create table sys_date
(
    year    VARCHAR(20) null comment '年',
    month   VARCHAR(20) null comment '月',
    day     VARCHAR(20) null comment '日',
    week    VARCHAR(20) null comment '周',
    quarter VARCHAR(20) null comment '季度',
    ms      BIGINT(19)  not null comment '毫秒'
        primary key
)
    charset = utf8mb4;

